import { SimpleGrid, Box } from "@chakra-ui/react";
import Form from "./Form";
import ListOfBooks from "./ListOfBooks";

const Home: React.FC =() => {


    return(
        <SimpleGrid columns={3} spacing={10}>
            <Box height='200px'>
                <Form />
            </Box>
            <Box height='100px'>
                <ListOfBooks />
            </Box>
            <Box height='80px'></Box>
            <Box height='80px'></Box>
            <Box height='80px'></Box>
        </SimpleGrid>
    )
}


export default Home;
